Private's OktoberSexFest II, the highly anticipated sequel to last year's Best International Movie winner at Venus in Berlin is now available. After receiving a surprising message that he has inherited an old tavern from his recently deceased uncle, Marc decides to bring the old place back to its former glory. Together with his trusted friends he sets about organizing a reopening that will see a lot more than a keg of beer being tapped. Beer and big stars are the order of the day and hot newcomers like the lovely Tina Hot and Uma Zex guarantee some very foamy head. As if that were not enough, Bella Baby appears in one of her truly rare scenes while Ana Rose and Victoria Red complete the female cast. Thick heavy sausages and hungry harlots come together in Private's tribute to the epic Munich beer festival. Enjoy the party!
